		var _imageHeight = 0; 
		var _imageWidth = 0;
		var _i = null;
		var _getImagePos = function(){
			var _canvas_size = _network.visible_size;
			return{
				top:_canvas_size.height*0.25 - _imageHeight * 0.5,
				left:_canvas_size.width*0.5 - _imageWidth * 0.5
			}
		};
		var addLoadingImage = function(parent){
			var _loadingImage = _network.getLoadingBarImage();
			if(!_loadingImage){
				_i = new Image();
				_i.src = imageUrl;
				_i.onload = function(){
					_imageHeight = _i.height;
					_imageWidth = _i.width;
					var _imagePos = _getImagePos();			
					parent.appendChild(_i);
					_i.setAttribute('style', 'display:block;position:absolute;top:'+ _imagePos.top +'px;left:'+ _imagePos.left +'px;');
				}
				_network.addLoadingBar(_loading);
			}else{
				_loading.adjustLoadingBarPosition();
				_loadingImage.style.display = 'block';
			}
		};
