    			draw_line:function(line, network){
    				var funSetLabel = network.setLabel, label = '';
    				if((funCustomized.setVisible && funCustomized.setVisible(line)) || !funCustomized.setVisible){
    					line.setDistRound(network.common.constants.arrow.dist_round);
    					var line_location = line.line_location(), start_location = line_location.start_location, end_location = line_location.end_location, style = line.getStyle(), bundles = network.bundles();
    					this.strokeWeight(style.weight);
    					if(tools.isArray(style.color)){
    						this.stroke.apply(null, style.color);
    					}else{
    						this.stroke(style.color);
    					}
    					var fromNode = line.getFromNode(), endNode = line.getEndNode();
    					if(!(fromNode === endNode && fromNode instanceof topo.Group)){
    						var bundle = bundles.isExistInBundle(line);
    						if(bundle){
    							views.draw_bundles.call(this, bundle, network);
    						}else{
    							var dash_len_constant = line.getStyle('dash-line-len')?line.getStyle('dash-line-len'):10;
    							var s_x = start_location.x, s_y = start_location.y, e_x = end_location.x, e_y = end_location.y;
    							if(line.getStyle('line-style') === 'dashed'){
    								var line_points = [];
    								var line_len = Math.sqrt(Math.pow(Math.abs(e_x - s_x), 2) + Math.pow(Math.abs(e_y - s_y), 2));
    								if(line_len > dash_len_constant){
    									var dash_count = Math.round(line_len / dash_len_constant);
    									for(var i=0; i<=dash_count; i++) { 
    									  var x = this.lerp(e_x, s_x, i/dash_count); 
    									  var y = this.lerp(e_y, s_y, i/dash_count);
    									  line_points.push([x, y]);
    									} 
    									for(var i=0, len=line_points.length; i<len; i=i+2){
    										var point = line_points[i];
    										var next_point = line_points[i+1];
    										if(line_points[i+1])
    											this.line(point[0], point[1], next_point[0], next_point[1]);
    									}
    								}else{
    									this.line(s_x, s_y, e_x, e_y);
    								}
    							}else{
    								this.line(s_x, s_y, e_x, e_y);
    							}
    							//this.ellipse(end_location.x, end_location.y, 5, 5);
    							var points = tools.arrow_points({
    								x:end_location.x,
    								y:end_location.y
    							}, line.getAngel());
    							views.draw_arrow.call(this, points, line);
    							if(line.bidirectional){
    								points = tools.arrow_points({
    									x:start_location.x,
    									y:start_location.y
    								}, line.getAngel() - Math.PI);
    								views.draw_arrow.call(this, points, line);
    							}
    							if(funSetLabel){
    								var midPoint = tools.getMidLinePoint(start_location.x, start_location.y, end_location.x, end_location.y);
    								label = funSetLabel(line);
    								views.label_style.call(this);
    								this.text(label, midPoint.x, midPoint.y);
    							}
    						}
    					}	
    				}
    			},
